	(82, 1, 142, 13, 0, 0, 'PERFORMANCE***\n\nYii2 framwork supported very strong technique about cache in many methods. So, you should use appropriate cache for data if that data change rarely and big data to improve system performance. Some cases you should consider to optimize your code to increase performance.\n\nPhp.\n\n    For variable only use one time, no declare.\n    Only declare necessary variable.\n\nMysql.\n\n    No use join so much in case of joining many tables together.\n    Select only necessary columns, no select redundant column or select all.\n    Database query no loop so much.', 'PERFORMANCE***\n\nYii2 framwork supported very strong technique about cache in many methods. So, you should use appropriate cache for data if that data change rarely and big data to improve system performance. Some cases you should consider to optimize your code to increase performance.\n\nPhp.\n\n    For variable only use one time, no declare.\n    Only declare necessary variable.\n\nMysql.\n\n    No use join so much in case of joining many tables together.\n    Select only necessary columns, no select redundant column or select all.\n    Database query no loop so much.', b'0', 1465543938, 1465543938, 13, 13, b'0'),
